import React, {Component} from 'react';
import "./css/main.css";

class Main extends Component {
    render(){
        return(
            <div className="container">
                <input placeholder="Nickname" /><br/>
                <input placeholder="E-mail" /><br/>
                <input placeholder="Company" /><br/>
                <input placeholder="Job" /><br/>
                <Button variant="success">가입하기</Button>
                <Button variant="warning">다시 생각해보기</Button>
            </div>
        );
    }    
}  

export default Main;
